import React, {Component} from 'react';
import ReactPlayer from "react-player";
class UsefulVideos extends Component {
    render() {
        return (
            <>
                <div className={"useful-videos"}>

                    <ReactPlayer url={"https://www.youtube.com/watch?v=440LVMY8lO4&feature=youtu.be&ab_channel=HumanDevelopmentMedia"} controls={true}/>





                </div>



            </>

        );
    }
}

export default UsefulVideos;
